import React from "react";
import {Card } from "react-bootstrap";

function Jobs({ job }) {
  return (
    <Card className="my-3 p-3 round">
      <a href={"job/${job.Id}"}></a>
      <Card.Body>
        <a href={"job/${job.Id}"}>
          <Card.Title as="div">
            <h3></h3>{job.JobTitle}
          </Card.Title>
        </a>
        <Card.Text as='div'>
            <div className = "my-3">
                {job.Companydescription}
            </div>
        </Card.Text>
        <Card.Text as='div'>
            <div className = "my-4">
                {job.Location}
            </div>
        </Card.Text>
      </Card.Body>
    </Card>
  );
}

export default Jobs;
